function NavBar(props) {

    if(props.loggedIn) {

        return <div

            className = "navbar navbar-expand-lg navbar-light bg-light"

        >

            <NavContainer />

        </div>

    }

    return <h1>You are not logged in</h1>

}


export default NavBar;
